    data: |
      SELECT - col1 + col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE 74 NOT IN ( - + 42, ( + col1 ) * + 42 );
  - name: tab2

outputs:
  - name: q6966.out
    data: |
      -13
      -5
      8
